*.router*.ppp[0].queue.htbTreeConfig = readJSON("configs/htbTree/AllSlices.json")
*.router*.ppp[0].queue.classifier.defaultGateIndex = 0
*.router0.ppp[0].queue.classifier.packetFilters = [expr(ipv4.srcAddress.str() =~ "10.0.0.0"),expr(ipv4.srcAddress.str() =~ "10.0.0.4"),expr(ipv4.srcAddress.str() =~ "10.0.0.8"),expr(ipv4.srcAddress.str() =~ "10.0.0.12"),expr(ipv4.srcAddress.str() =~ "10.0.0.16")]
*.router1.ppp[0].queue.classifier.packetFilters = [expr(ipv4.destAddress.str() =~ "10.0.0.0"),expr(ipv4.destAddress.str() =~ "10.0.0.4"),expr(ipv4.destAddress.str() =~ "10.0.0.8"),expr(ipv4.destAddress.str() =~ "10.0.0.12"),expr(ipv4.destAddress.str() =~ "10.0.0.16")]

**.connFIX0.datarate = 100Mbps
**.connFIX0.delay = 40ms

